import React,{useState} from 'react';
import { auth } from "./firebase-config";
import {createUserWithEmailAndPassword,GoogleAuthProvider,signInWithPopup} from "firebase/auth";
const Form = () => {
    const [email,SetRegisterEmail] = useState("");
    const [password,SetRegisterPassword] = useState("")
    const Create = async () => {
        try {
        const user = await createUserWithEmailAndPassword(auth,email,password);
        console.log(user)
        } catch(error) {
            console.log(error)
        }
    }
    const handleSubmit = (e) => {
        e.preventDefault()
    }
    const google = async () => {
        try {
            const provider = await new GoogleAuthProvider(auth);
            signInWithPopup(auth,provider);
            console.log(provider)
        } catch(error) {
            console.log(error)
        }
    }
    return (
        <div className="contain-form">
            <form action="" className="form" onSubmit={(e) => handleSubmit (e)}>
                <h1 className="in">Sign Up</h1>
                <div className="label">
                <input type="text"  placeholder="Email" onChange={(e) => SetRegisterEmail(e.target.value)}/><br />
  <input type="password" placeholder="Password" onChange={(e) => SetRegisterPassword(e.target.value)}/><br />
  <input type="submit" value="Creat Account" className="submit" onClick={Create}/>
  <div className="center">
      <h3 className="or">or</h3>
  </div>
  <button className="btn" onClick={google}>
      <img src="data:image/png;base64," alt="" />
      <h4 className="google">Continue With Google</h4>
  </button>

                </div>
            </form>
        </div>
    )
}

export default Form
